import React, { createContext, useState } from 'react';
import { TUserData } from './models/user'
import { TAppContextProps, TContextValue } from './models/context';

export const CurrentUserContext = createContext<TContextValue | null>(null);

export const AppContext = ({ children }: TAppContextProps) => {

const [currentUserData, setCurrentUserData] = useState (null);

return (
  <CurrentUserContext.Provider 
    value={{
      currentUserData,
      setCurrentUserData,
    }}>
      {children}
  </CurrentUserContext.Provider>
);

};
